import { Container, Nav, Row, Tab, } from "react-bootstrap";



function Projects() {

    const projects = [
        {
            title: "movie",
            description: "something",
            image: "kjas",

        },
        {
            title: "movie",
            description: "something",
            image: "kjas",

        },
        {
            title: "movie",
            description: "something",
            image: "kjas",

        },
        {
            title: "movie",
            description: "something",
            image: "kjas",

        },
        {
            title: "movie",
            description: "something",
            image: "kjas",

        },
    ];
    return (
        <section className="projects" id="projects">
            <Container>
                <Row>
                    <h2> Projects</h2>
                    <p>something to introduct something</p>
                <Tab.Container className= "projects-tab"defaultActiveKey="first">
                <Nav variant="pills" defaultActiveKey="/home" className="flex-row">
                        <Nav.Item>
                            <Nav.Link eventKey="first">Tab 1</Nav.Link>
                        </Nav.Item>
                        <Nav.Item>
                            <Nav.Link eventKey="second">Tab 2</Nav.Link>
                        </Nav.Item>
                        <Nav.Item>
                            <Nav.Link eventKey="third">Tab 3</Nav.Link>

                        </Nav.Item>
                    </Nav>
                    <Tab.Content>
                        <Tab.Pane>
                            <Row>
                                {
                                    projects.map((project, index)=>{
                                        return(
                                            <p>                                             {
                                                   project.title
                                                }
                                            </p>
                                        );
                                    })
                                }
                            </Row>
                        </Tab.Pane>
                    </Tab.Content>
                </Tab.Container>
                </Row>
            </Container>
        </section>
    );
}
export default Projects;
